import React from 'react'
import { useDispatch, useSelector } from 'react-redux';
import { getDetails } from '../../Redux/actions';
import { Link } from 'react-router-dom';
import { useEffect } from 'react';
import './Detail.css';


export default function Detail(props) {
  
  const dispatch = useDispatch()

  useEffect(() => {
    dispatch(getDetails(props.match.params.id));
  }, [props.match.params.id, dispatch]);

  const myDog = useSelector((state) => state.detail)

  console.log(myDog)
  
 

  return(
        <div className="divDetail">
            <Link to='/home'><button id="home" className="welcome"><span>Back</span></button></Link>
            <Link to='/dogs'>
                <button className="welcome"><span>Dog Create</span></button>
            </Link>
    {
        myDog.length > 0 ?
        <div className='containerDog'>
            <div>
            <h1 claseName="name" > Soy {myDog[0].name}</h1>
            <ul className="asd">
                <li>
                    <div>
                        <img src = {myDog[0].img? myDog[0].img : myDog[0].image} alt='' width="250px" height="190px"/>
                    </div>
                </li>
            
            <h3 className='caracts'>Temperament: </h3>
            <ul className="allTemps">
            <p>{myDog[0].createdInDB? myDog[0].temperaments.map((el) => el.name).join(", ")
                : myDog[0].temperament}
            </p>
            </ul>
            <div>
            <h4 className='caracts'> Height: </h4>
            <h4> Min: {myDog[0].height_min} cm</h4>
            <h4> Max: {myDog[0].height_max} cm</h4>  
            <h4 className='caracts'>Weight: </h4>
            <h4>Min: {myDog[0].weight_min} kg</h4>
            <h4>Max: {myDog[0].weight_max} kg</h4>
            <h3 className='caracts'>Life_span: {myDog[0].life_span}</h3>
            
            </div>
            </ul>
            </div>

        </div>: <p>loading...</p>
    }
    
    </div>
    )
}
